  // \u6ed1\u5757\u3001\u53ca\u524d\u540e\u80cc\u666f\u7684\u914d\u7f6e\n  readonly slider?: SliderOption;\n\n  // \u662f\u5426\u8fc7\u6ee4\u8fb9\uff0c\u82e5\u4e3a true\uff0c\u5219\u9700\u8981\u914d\u5408\u8fb9\u6570\u636e\u4e0a\u6709 date \u5b57\u6bb5\uff0c\u8fc7\u6ee4\u8282\u70b9\u540c\u65f6\u5c06\u4e0d\u6ee1\u8db3 date \u5728\u9009\u4e2d\u8303\u56f4\u5185\u7684\u8fb9\u4e5f\u8fc7\u6ee4\u51fa\u53bb\n  // \u82e5\u4e3a false\uff0c\u5219\u4ec5\u8fc7\u6ee4\u8282\u70b9\u4ee5\u53ca\u4e24\u7aef\u8282\u70b9\u90fd\u88ab\u8fc7\u6ee4\u51fa\u53bb\u7684\u8fb9\n  //\u3010deprecate\u3011\uff0c\u7531 filterItemTypes \u66ff\u4ee3\n  readonly filterEdge?: boolean;\n\n  // \u8fc7\u6ee4\u7684\u7c7b\u578b, ['node', 'edge'], \u9ed8\u8ba4\u4e3a ['node']\n  readonly filterItemTypes?: string[];\n\n  // \u5bb9\u5668\u7684 CSS \u6837\u5f0f\n  readonly containerCSS?: Object;\n\n  // \u662f\u5426\u901a\u8fc7 changeData \u6765\u8fdb\u884c\u7b5b\u9009\uff0cfalse \u5219\u4f7f\u7528 hideItem\n  readonly changeData?: boolean;\n\n  /** \u662f\u5426\u7f6e\u4e8e\u56fe\u5bb9\u5668\u5f53\u4e2d */\n  readonly putInGraphContainer?: boolean;\n\n  // \u5f53\u65f6\u95f4\u8f74\u8303\u56f4\u53d1\u751f\u53d8\u5316\u65f6\u7684\u56de\u8c03\u51fd\u6570\n  rangeChange?: (graph: IGraph, minValue: string, maxValue: string) => void;\n\n  // \u7528\u6237\u6839\u636e\u8282\u70b9/\u8fb9\u6570\u636e\u8fd4\u56de\u5bf9\u5e94\u65f6\u95f4\u503c\u7684\u65b9\u6cd5\n  getDate?: (d: any) => number;\n\n  // \u7528\u6237\u6839\u636e\u8282\u70b9/\u8fb9\u6570\u636e\u8fd4\u56de\u5bf9\u5e94 value \u7684\u65b9\u6cd5\u3002value \u7528\u4e8e\u5728 type \u4e3a trend \u7684\u65f6\u95f4\u8f74\u4e0a\u663e\u793a\u8d8b\u52bf\u7ebf\n  getValue?: (d: any) => number;\n\n  // \u5728\u8fc7\u6ee4\u56fe\u5143\u7d20\u65f6\u662f\u5426\u8981\u5ffd\u7565\u67d0\u4e9b\u5143\u7d20\uff0c\u8303\u56f4 true\uff0c\u5219\u5ffd\u7565\u3002\u5426\u5219\u6309\u7167\u6b63\u5e38\u8fc7\u6ee4\u903b\u8f91\u5904\u7406\n  shouldIgnore?: (\n    itemType: 'node' | 'edge',\n    model: any,\n    dateRage: { min: number; max: number },\n  ) => boolean;\n}\n\nexport default class TimeBar extends Base {\n  constructor(config?: TimeBarConfig) {\n    super(config);\n  }\n  private cacheGraphData: GraphData;\n\n  public getDefaultCfgs(): TimeBarConfig {\n    return {\n      container: null,\n      className: 'g6-component-timebar',\n      padding: 10,\n      type: 'trend',\n      trend: {\n        data: [],\n        isArea: false,\n        smooth: true,\n      },\n      slider: {\n        start: 0,\n        end: 0.1,\n        minText: 'min',\n        maxText: 'max',\n      },\n      filterEdge: false, // deprecate\uff0c\u7531 filterItemTypes \u66ff\u4ee3\n      filterItemTypes: ['node'],\n      containerCSS: {},\n      putInGraphContainer: true,\n    };\n  }\n\n  /**\n   * \u521d\u59cb\u5316 TimeBar \u7684\u5bb9\u5668\n   */\n  public initContainer() {\n    const graph: IGraph = this.get('graph');\n    const { width, height, putInGraphContainer } = this._cfgs;\n    const className: string = this.get('className') || 'g6-component-timebar';\n\n    let container: HTMLDivElement | null | string = this.get('container');\n\n    let timeBarContainer;\n    if (!container) {\n      timeBarContainer = createDom(`<div class='${className}'></div>`);\n      modifyCSS(timeBarContainer, { position: 'relative' });\n    } else {\n      if (isString(container)) {\n        container = document.getElementById(container) as HTMLDivElement;\n      }\n      timeBarContainer = container;\n    }\n\n    if (putInGraphContainer) {\n      const graphContainer = this.get('graph').get('container');\n      graphContainer.appendChild(timeBarContainer);\n    }\n\n    this.set('timeBarContainer', timeBarContainer);\n\n    let canvas;\n    const renderer = graph.get('renderer');\n    if (renderer === 'SVG') {\n      canvas = new GSVGCanvas({\n        container: timeBarContainer,\n        width,\n        height,\n      });\n    } else {\n      canvas = new GCanvas({\n        container: timeBarContainer,\n        width,\n        height,\n      });\n    }\n    // \u6839\u636e\u4f20\u5165\u7684\u53c2\u6570\u4fee\u6539\u5bb9\u5668 CSS \u6837\u5f0f\n    if (this.get('containerCSS'))\n      modifyCSS(timeBarContainer, this.get('containerCSS'));\n    this.set('canvas', canvas);\n  }\n\n  public init() {\n    this.initContainer();\n    const canvas: ICanvas = this.get('canvas');\n    const timeBarGroup = canvas.addGroup({\n      name: 'timebar-group',\n    });\n\n    this.set('timeBarGroup', timeBarGroup);\n\n    this.renderTrend();\n    this.initEvent();\n  }\n\n  private renderTrend() {\n    const {\n      width,\n      height,\n      x,\n      y,\n      padding,\n      type,\n      trend,\n      slider,\n      tick,\n      backgroundStyle,\n      foregroundStyle,\n    } = this._cfgs;\n    const { data, ...other } = trend;\n\n    const graph = this.get('graph');\n    const group = this.get('timeBarGroup');\n    const canvas = this.get('canvas');\n\n    let timebar = null;\n    const getValue = this.get('getValue');\n    timebar = new TrendTimeBar({\n      graph,\n      canvas,\n      group,\n      type,\n      x: 0,\n      y: 0,\n      width,\n      height: height,\n      blockHeight: 40,\n      padding,\n      backgroundStyle,\n      foregroundStyle,\n      trendCfg: {\n        ...other,\n        data: data.map(d => getValue?.(d) || d.value),\n      },\n      ...slider,\n    });\n\n    this.set('timebar', timebar);\n  }\n\n  private filterData(evt) {}\n\n  private afterrenderListener = e => this.filterData({});\n  private valueChangeListener = throttle(\n    e => this.filterData(e), // \u4e0d\u53ef\u7b80\u5199\uff0c\u5426\u5219 filterData \u4e2d this \u6307\u9488\u4e0d\u5bf9\n    200,\n    {\n      trailing: true,\n      leading: true,\n    },\n  ) as any;\n\n  public changeData = e => {\n    const graph: IGraph = this.get('graph');\n    this.cacheGraphData = graph.get('data');\n    this.filterData({});\n  };\n\n  private initEvent() {\n    const graph: IGraph = this.get('graph');\n    // \u56fe\u6570\u636e\u53d8\u5316\uff0c\u66f4\u65b0\u65f6\u95f4\u8f74\u7684\u539f\u59cb\u6570\u636e\n    graph.on('afterchangedata', this.changeData);\n    // \u56fe\u6e32\u67d3\uff0c\u89e6\u53d1\u65f6\u95f4\u8f74\u7b5b\u9009\n    graph.on('afterrender', this.afterrenderListener);\n    // \u65f6\u95f4\u8f74\u7684\u503c\u53d1\u751f\u6539\u53d8\u7684\u4e8b\u4ef6\uff0c\u89e6\u53d1\u7b5b\u9009\n    graph.on(VALUE_CHANGE, this.valueChangeListener);\n  }\n\n  public destroy() {\n    const graph: IGraph = this.get('graph');\n    graph.off('afterchangedata', this.changeData);\n    graph.off('afterrender', this.afterrenderListener);\n    graph.off(VALUE_CHANGE, this.valueChangeListener);\n    const timebar = this.get('timebar');\n    if (timebar && timebar.destory) {\n      timebar.destory();\n    }\n\n    super.destroy();\n\n    const timeBarContainer = this.get('timeBarContainer');\n    if (timeBarContainer) {\n      let container: HTMLElement | null = this.get('container');\n      if (!container) {\n        container = this.get('graph').get('container');\n      }\n      if (isString(container)) {\n        container = document.getElementById(container) as HTMLElement;\n      }\n      if (container === timeBarContainer) {\n        container = container.parentElement;\n      }\n      container.removeChild(timeBarContainer);\n    }\n  }\n}",E="import { wrapBehavior, each, deepMix } from '@antv/util';\nimport { IAbstractGraph as IGraph, IG6GraphEvent } from '@antv/g6-core';\n\nexport interface IPluginBaseConfig {\n  container?: HTMLDivElement | string | null;\n  className?: string;\n  graph?: IGraph;\n  [key: string]: any;\n}\n\ninterface EventMapType {\n  [key: string]: any;\n}\n\nexport default abstract class PluginBase {\n  private _events: EventMapType;\n\n  public _cfgs: IPluginBaseConfig;\n\n  public destroyed: boolean;\n\n  /**\n   * \u63d2\u4ef6\u57fa\u7c7b\u7684\u6784\u9020\u51fd\u6570\n   * @param cfgs \u63d2\u4ef6\u7684\u914d\u7f6e\u9879\n   */\n  constructor(cfgs?: IPluginBaseConfig) {\n    this._cfgs = deepMix(this.getDefaultCfgs(), cfgs);\n    this._events = {};\n    this.destroyed = false;\n  }\n\n  /**\n   * \u83b7\u53d6\u9ed8\u8ba4\u7684\u63d2\u4ef6\u914d\u7f6e\n   */\n  public getDefaultCfgs() {\n    return {};\n  }\n\n  /**\n   * \u521d\u59cb\u5316\u63d2\u4ef6\n   * @param graph IGraph \u5b9e\u4f8b\n   */\n  public initPlugin(graph: IGraph) {\n    const self = this;\n    self.set('graph', graph);\n    const events = self.getEvents();\n\n    const bindEvents: EventMapType = {};\n\n    each(events, (v, k) => {\n      const event = wrapBehavior(self, v) as (e: IG6GraphEvent) => void;\n      bindEvents[k] = event;\n      graph.on(k, event);\n    });\n    this._events = bindEvents;\n\n    this.init();\n  }\n\n  /**\n   * \u521d\u59cb\u5316\u65b9\u6cd5\uff0c\u4f9b\u5b50\u7c7b\u5b9e\u73b0\n   */\n  public abstract init();\n\n  /**\n   * \u83b7\u53d6\u63d2\u4ef6\u4e2d\u7684\u4e8b\u4ef6\u548c\u4e8b\u4ef6\u5904\u7406\u65b9\u6cd5\uff0c\u4f9b\u5b50\u7c7b\u5b9e\u73b0\n   */\n  public getEvents() {\n    return {};\n  }\n\n  /**\n   * \u83b7\u53d6\u914d\u7f6e\u9879\u4e2d\u7684\u67d0\u4e2a\u503c\n   * @param key \u952e\u503c\n   */\n  public get(key: string) {\n    return this._cfgs?.[key];\n  }\n\n  /**\n   * \u5c06\u6307\u5b9a\u7684\u503c\u5b58\u50a8\u5230 cfgs \u4e2d\n   * @param key \u952e\u503c\n   * @param val \u8bbe\u7f6e\u7684\u503c\n   */\n  public set(key: string, val: any) {\n    this._cfgs[key] = val;\n  }\n\n  /**\n   * \u9500\u6bc1\u65b9\u6cd5\uff0c\u4f9b\u5b50\u7c7b\u590d\u5199\n   */\n  public destroy() { }\n\n  /**\n   * \u9500\u6bc1\u63d2\u4ef6\n   */\n  public destroyPlugin() {\n    this.destroy();\n    const graph = this.get('graph');\n    const events = this._events;\n    each(events, (v, k) => {\n      graph.off(k, v);\n    });\n    (this._events as EventMapType | null) = null;\n    (this._cfgs as IPluginBaseConfig | null) = null;\n    this.destroyed = true;\n  }\n}",O="import { ShapeStyle } from '@antv/g6-core';\n\nexport const TIMELINE_START = 'timebarstartplay';\nexport const TIMELINE_END = 'timebarendplay';\n\nexport const VALUE_CHANGE = 'valuechange';\n\nexport const TIMEBAR_CONFIG_CHANGE = 'timebarConfigChanged';\n\nexport const PLAY_PAUSE_BTN = 'playPauseBtn';\nexport const NEXT_STEP_BTN = 'nextStepBtn';\nexport const PRE_STEP_BTN = 'preStepBtn';\n\nexport interface ExtendedShapeStyle extends ShapeStyle {\n  scale?: number;\n  offsetX?: number;\n  offsetY?: number;\n}",S="import { Event, IGroup, ICanvas, IShape } from '@antv/g-base';\nimport { get, size, assign, each, isNumber } from '@antv/util';\nimport { ext } from '@antv/matrix-util';\nimport Handler from './handler';\nimport { ShapeStyle, IAbstractGraph as IGraph } from '@antv/g6-core';\nimport {\n  VALUE_CHANGE,\n  TIMELINE_START,\n  TIMEBAR_CONFIG_CHANGE,\n  PLAY_PAUSE_BTN,\n  NEXT_STEP_BTN,\n  PRE_STEP_BTN,\n  TIMELINE_END,\n} from './constant';\n\nconst transform = ext.transform;\n\n/**\n * \u4e00\u4e9b\u9ed8\u8ba4\u7684\u6837\u5f0f\u914d\u7f6e\n */\n\nexport const BACKGROUND_STYLE = {\n  fill: '#416180',\n  opacity: 0.05,\n};\n\nexport const FOREGROUND_STYLE = {\n  fill: '#5B8FF9',\n  opacity: 0.3,\n  cursor: 'grab',\n};\n\nexport const DEFAULT_HANDLER_WIDTH = 2;\n\nexport const HANDLER_STYLE = {\n  width: DEFAULT_HANDLER_WIDTH,\n  height: 24,\n};\n\nexport const TEXT_STYLE = {\n  textBaseline: 'middle',\n  fill: '#000',\n  opacity: 0.45,\n};\n\nexport const TICK_LABEL_STYLE = {\n  textAlign: 'center',\n  textBaseline: 'top',\n  fill: '#607889',\n  opacity: 0.35,\n};\nexport const TICK_LINE_STYLE = {\n  lineWidth: 1,\n  stroke: '#ccc',\n};\n\nexport type SliderOption = Partial<{\n  readonly width?: number;\n  readonly height?: number;\n  readonly blockHeight?: number;\n  readonly backgroundStyle?: ShapeStyle;\n  readonly foregroundStyle?: ShapeStyle;\n  // \u6ed1\u5757\u6837\u5f0f\n  readonly handlerStyle?: {\n    width?: number;\n    height?: number;\n    style?: ShapeStyle;\n  };\n  readonly textStyle?: ShapeStyle;\n  // \u521d\u59cb\u4f4d\u7f6e\n  readonly start: number;\n  readonly end: number;\n  // \u6ed1\u5757\u6587\u672c\n  readonly minText: string;\n  readonly maxText: string;\n}>;\n\nexport type TickCfg = {\n  readonly ticks?: {\n    date: string;\n    value: string;\n  }[];\n  readonly tickLabelStyle?: ShapeStyle;\n  readonly tickLineStyle?: ShapeStyle;\n};\n\ninterface TrendTimeBarConfig extends SliderOption {\n  readonly graph: IGraph;\n  readonly canvas: ICanvas;\n  readonly group: IGroup;\n  // position size\n  readonly x: number;\n  readonly y: number;\n  readonly width: number;\n  readonly height: number;\n  readonly padding: number;\n  readonly type: 'trend' | 'simple';\n  // style\n  readonly backgroundStyle?: ShapeStyle;\n  readonly foregroundStyle?: ShapeStyle;\n  readonly tick?: TickCfg;\n\n  // \u81ea\u5b9a\u4e49\u6807\u7b7e\u683c\u5f0f\u5316\u51fd\u6570\n}\n\nexport default class TrendTimeBar {\n  private group: IGroup;\n\n  private graph: IGraph;\n\n  private canvas: ICanvas;\n\n  // \u4f4d\u7f6e\u5927\u5c0f\u914d\u7f6e\n  public x: number;\n\n  public y: number;\n\n  public width: number;\n\n  public height: number;\n\n  public blockHeight: number;\n\n  private padding: number;\n\n  // \u6837\u5f0f\u914d\u7f6e\n  private backgroundStyle: any;\n\n  private foregroundStyle: any;\n\n  /* \u524d\u666f\u6846\uff0c\u9009\u4e2d\u7684\u533a\u57df */\n  private foregroundShape: IShape;\n\n  // \u4ea4\u4e92\u76f8\u5173\u7684\u6570\u636e\u4fe1\u606f\n  private start: number;\n\n  private end: number;\n\n  private currentHandler: Handler | IShape;\n\n  private prevY: number = 0;\n\n  private centerX: number = 0;\n  private centerY: number = 0;\n\n  constructor(cfg: TrendTimeBarConfig) {\n    const {\n      x = 0,\n      y = 0,\n      width = 100,\n      height,\n      blockHeight,\n      padding = 10,\n      backgroundStyle = {},\n      foregroundStyle = {},\n      // \u7f29\u7565\u8f74\u7684\u521d\u59cb\u4f4d\u7f6e\n      start = 0,\n      end = 1,\n      group,\n      graph,\n      canvas,\n    } = cfg;\n    console.log('cfg: ', cfg);\n\n    this.graph = graph;\n    this.canvas = canvas;\n    this.group = group;\n    this.blockHeight = blockHeight;\n    // position size\n    this.x = x;\n    this.y = y;\n    this.width = width;\n    this.height = height;\n    this.padding = padding;\n    // style\n    this.backgroundStyle = { ...BACKGROUND_STYLE, ...backgroundStyle };\n\n    this.foregroundStyle = { ...FOREGROUND_STYLE, ...foregroundStyle };\n\n    // \u521d\u59cb\u4fe1\u606f\n    this.start = start;\n    this.end = end;\n\n    this.renderSlider();\n  }\n\n  /**\n   * \u66f4\u65b0\u914d\u7f6e\n   * @param cfg\n   */\n  public update(cfg: Partial<TrendTimeBarConfig>) {\n    const { x, y, width, height, minText, maxText, start, end } = cfg;\n\n    // start\u3001end \u53ea\u80fd\u662f 0~1 \u8303\u56f4\n    this.start = Math.min(1, Math.max(start, 0));\n    this.end = Math.min(1, Math.max(end, 0));\n\n    // \u5982\u679c\u4f20\u4e86\u5219\u66f4\u65b0\uff0c\u6ca1\u6709\u4f20\u5219\u4e0d\u66f4\u65b0\n    // @ts-ignore\n    assign(this, {\n      x,\n      y,\n      width,\n      height,\n      minText,\n      maxText,\n    });\n\n    // \u66f4\u65b0 ui\uff0c\u4e0d\u81ea\u52a8\u7ed8\u5236\n    this.updateUI();\n  }\n\n  /**\n   * \u521d\u59cb\u5316\u7ec4\u4ef6\u7ed3\u6784\n   * @private\n   */\n  private renderSlider() {\n    const { width, height } = this;\n    const sliderGroup = this.group.addGroup({\n      name: 'slider-group',\n    });\n\n    // 1. \u80cc\u666f\n    sliderGroup.addShape('rect', {\n      attrs: {\n        x: 0,\n        y: 0,\n        width,\n        height: this.height,\n        ...this.backgroundStyle,\n      },\n      name: 'background',\n    });\n\n    // 3. \u524d\u666f \u9009\u4e2d\u80cc\u666f\u6846\n    this.foregroundShape = this.group.addGroup().addShape('rect', {\n      attrs: {\n        x: 0,\n        y: 0,\n        width,\n        height: this.blockHeight,\n        ...this.foregroundStyle,\n      },\n      name: 'foreground-shape',\n    });\n    this.foregroundShape.on('mousedown', e => {\n      e.target.attr('cursor', 'grabbing');\n    });\n    this.foregroundShape.on('mouseup', e => {\n      e.target.attr('cursor', this.foregroundStyle.cursor || 'grab');\n    });\n\n    // \u521d\u59cb\u5316 minText \u548c maxText\uff0c\u65b9\u4fbf\u8ba1\u7b97\u5b83\u4eec\u7684 bbox\n    this.updateStartEnd(0);\n\n    // \u6839\u636e start end \u66f4\u65b0 ui \u7684\u4f4d\u7f6e\u4fe1\u606f\n    this.updateUI();\n\n    // \u79fb\u52a8\u5230\u5bf9\u5e94\u7684\u4f4d\u7f6e\n    sliderGroup.move(this.x, this.y);\n\n    // \u7ed1\u5b9a\u4e8b\u4ef6\u9f20\u6807\u4e8b\u4ef6\n    this.bindEvents();\n  }\n\n  /**\n   * \u7ed1\u5b9a\u4e8b\u4ef6\uff1a\n   *  - \u70b9\u51fb\n   *  - \u6ed1\u52a8\n   *  - \u62d6\u62fd\n   *  - \u6eda\u52a8\n   * @private\n   */\n  private bindEvents() {\n    // 3. \u524d\u666f\u9009\u4e2d\u533a\u57df\n    this.foregroundShape.on(\n      'mousedown',\n      this.onMouseDown(this.foregroundShape),\n    );\n    this.foregroundShape.on(\n      'touchstart',\n      this.onMouseDown(this.foregroundShape),\n    );\n  }\n\n  private onMouseDown = (handler: Handler | IShape) => (e: Event) => {\n    // 1. \u8bb0\u5f55\u70b9\u51fb\u7684\u6ed1\u5757\n    this.currentHandler = handler;\n\n    const event = e.originalEvent as MouseEvent;\n\n    const { x: centerX, y: centerY } = this.graph.getGraphCenterPoint();\n    this.centerX = centerX;\n    this.centerY = centerY;\n    // 2. \u5b58\u50a8\u5f53\u524d\u70b9\u51fb\u4f4d\u7f6e\n    event.stopPropagation();\n    event.preventDefault();\n\n    // \u517c\u5bb9\u79fb\u52a8\u7aef\u83b7\u53d6\u6570\u636e\n    this.prevY = get(event, 'touches.0.pageY', event.pageY);\n\n    // 3. \u5f00\u59cb\u6ed1\u52a8\u7684\u65f6\u5019\uff0c\u7ed1\u5b9a move \u548c up \u4e8b\u4ef6\n    const containerDOM = this.canvas.get('container');\n\n    containerDOM.addEventListener('mousemove', this.onMouseMove);\n    containerDOM.addEventListener('mouseup', this.onMouseUp);\n    containerDOM.addEventListener('mouseleave', this.onMouseUp);\n\n    // \u79fb\u52a8\u7aef\u4e8b\u4ef6\n    containerDOM.addEventListener('touchmove', this.onMouseMove);\n    containerDOM.addEventListener('touchend', this.onMouseUp);\n    containerDOM.addEventListener('touchcancel', this.onMouseUp);\n  };\n\n  private onMouseMove = (e: MouseEvent) => {\n    // \u6ed1\u52a8\u8fc7\u7a0b\u4e2d\uff0c\u8ba1\u7b97\u504f\u79fb\uff0c\u66f4\u65b0\u6ed1\u5757\uff0c\u7136\u540e emit \u6570\u636e\u51fa\u53bb\n    e.stopPropagation();\n    e.preventDefault();\n    const y = e.pageY\n    console.log('y : ', y , this.prevY);\n    // \u6a2a\u5411\u7684 slider \u53ea\u5904\u7406 x\n    const offsetY = y - this.prevY;\n    console.log('offsetY: ', offsetY);\n    const offsetXRange = this.adjustOffsetRange(offsetY / this.height);\n    console.log('offsetXRange: ', offsetXRange);\n    if (offsetXRange > 0) {\n      this.graph.translate(0, 5);\n    }\n    if (offsetXRange < 0) {\n      this.graph.translate(0, -5);\n    }\n\n    // \u66f4\u65b0 start end range \u8303\u56f4\n    this.updateStartEnd(offsetXRange);\n    // \u66f4\u65b0 ui\n    this.updateUI();\n\n    this.prevY = y;\n  };\n\n  private onMouseUp = () => {\n    // \u7ed3\u675f\u4e4b\u540e\uff0c\u53d6\u6d88\u7ed1\u5b9a\u7684\u4e8b\u4ef6\n    if (this.currentHandler) {\n      this.currentHandler = undefined;\n    }\n\n    const containerDOM = this.canvas.get('container');\n    if (containerDOM) {\n      containerDOM.removeEventListener('mousemove', this.onMouseMove);\n      containerDOM.removeEventListener('mouseup', this.onMouseUp);\n      // \u9632\u6b62\u6ed1\u52a8\u5230 canvas \u5916\u90e8\u4e4b\u540e\uff0c\u72b6\u6001\u4e22\u5931\n      containerDOM.removeEventListener('mouseleave', this.onMouseUp);\n\n      // \u79fb\u52a8\u7aef\u4e8b\u4ef6\n      containerDOM.removeEventListener('touchmove', this.onMouseMove);\n      containerDOM.removeEventListener('touchend', this.onMouseUp);\n      containerDOM.removeEventListener('touchcancel', this.onMouseUp);\n    }\n  };\n\n  /**\n   * \u8c03\u6574 offsetRange\uff0c\u56e0\u4e3a\u4e00\u4e9b\u8303\u56f4\u7684\u9650\u5236\n   * @param offsetRange\n   */\n  private adjustOffsetRange(offsetRange: number): number {\n    // \u9488\u5bf9\u4e0d\u540c\u7684\u6ed1\u52a8\u7ec4\u4ef6\uff0c\u5904\u7406\u7684\u65b9\u5f0f\u4e0d\u540c\n    switch (this.currentHandler) {\n      case this.foregroundShape: {\n        const min = 0 - this.start;\n        const max = 1 - this.end;\n\n        return Math.min(max, Math.max(min, offsetRange));\n      }\n      default:\n        return 0;\n    }\n  }\n\n  /**\n   * \u66f4\u65b0\u8d77\u59cb\u3001\u7ed3\u675f\u7684\u63a7\u5236\u5757\u4f4d\u7f6e\u3001\u6587\u672c\u3001\u8303\u56f4\u503c\uff08\u539f\u59cb\u503c\uff09\n   * @param offsetRange\n   */\n  private updateStartEnd(offsetRange: number) {\n    // \u64cd\u4f5c\u4e0d\u540c\u7684\u7ec4\u4ef6\uff0c\u53cd\u9988\u4e0d\u4e00\u6837\n    switch (this.currentHandler) {\n      case this.foregroundShape:\n        this.start += offsetRange;\n        this.end += offsetRange;\n        break;\n      default:\n        break;\n    }\n  }\n\n  /**\n   * \u6839\u636e\u79fb\u52a8\u7684\u6bd4\u4f8b\u6765\u66f4\u65b0 ui\uff0c\u66f4\u65b0\u8303\u56f4\uff080-1 \u8303\u56f4\u7684\u6bd4\u4f8b\u503c\uff09\n   * @private\n   */\n  private updateUI() {\n    if (this.start < 0) {\n      this.start = 0;\n    }\n    if (this.start > 1) {\n      this.start = 1;\n    }\n    if (this.end > 1) {\n      this.end = 1;\n    }\n    if (this.end < 0) {\n      this.end = 0;\n    }\n\n    const min = this.y + this.start * this.height;\n    // const max = this.y + this.end * this.height;\n\n    this.foregroundShape.attr('y', min);\n  }\n\n  public destory() {\n    this.graph.off(VALUE_CHANGE, () => {\n      /* do nothing */\n    });\n\n    const group = this.group;\n\n    // 3. \u524d\u666f\u9009\u4e2d\u533a\u57df\n    this.foregroundShape.off('mousedown');\n    this.foregroundShape.off('touchstart');\n    this.foregroundShape.destroy();\n\n    group.off(`${PLAY_PAUSE_BTN}:click`);\n    group.off(`${NEXT_STEP_BTN}:click`);\n    group.off(`${PRE_STEP_BTN}:click`);\n    group.off(TIMEBAR_CONFIG_CHANGE);\n    group.destroy();\n  }\n}",k="/*\n * @Author: sfy\n * @Date: 2023-05-12 23:24:45\n * @LastEditors: sfy\n * @LastEditTime: 2023-05-12 23:24:46\n * @FilePath: /sqlG/src/Process/utils/index.ts\n * @Description: update here\n */\n\nexport * from './graphCtx'",_="/*\n * @Author: sfy\n * @Date: 2023-05-12 23:24:33\n * @LastEditors: sfy\n * @LastEditTime: 2023-05-12 23:24:34\n * @FilePath: /sqlG/src/Process/utils/graphCtx.ts\n * @Description: update here\n */\nimport React from 'react';\nexport const GraphContext = React.createContext<any>({});",M=".container {\n  border: 1px solid;\n  position: relative;\n  :global {\n    .g6-component-timebar {\n      position: absolute !important;\n      right: 0px;\n      top: 0px;\n    }\n  }\n}",A={"src.zh-CN-demo":{component:function(){var t=n("K+nK")["default"],e=n("OMN9"),r=t(n("q1tI"));console.log(1);var i=new e._promise((function(t,e){console.log(2),t("\u8fd9\u6b21\u4e00\u5b9a")}));i.then((function(t){console.log("fulfilled:",t)}),(function(t){console.log("rejected:",t)})),console.log(3);var o=function(){return"Promise"};return r["default"].createElement(o)},previewerProps:{sources:{_:{jsx:"import {_promise} from './index.ts'\nconsole.log(1);\nconst p1 = new _promise((resolve, reject) => {\nconsole.log(2);\n  resolve('\u8fd9\u6b21\u4e00\u5b9a');\n  //  reject('\u8fd9\u6b21buhui');\n})\np1.then(\n    result => {\n        console.log('fulfilled:', result);\n    },\n    reason => {\n        console.log('rejected:', reason)\n    }\n)\nconsole.log(3);\n\n// let p2 = new _promise((resolve, reject) => {\n//     reject('\u4e0b\u6b21\u4e00\u5b9a');\n// })\n// console.log(p2); \nimport React from 'react';\n\nexport default () => 'Promise';\n"},"index.ts":{imp